import React from "react";
import styled from "styled-components";

export default function TextButton(label) {
  return (
    <ButtonText>
      <p>{label}</p>
      <span></span>
    </ButtonText>
  );
}

const ButtonText = styled.div`
  border: 1px solid #37b3b8;
  border-radius: 20px;
  opacity: 1;
`;
